import React from 'react';

const ToDoList = (props) => {
  const deleteItem = () => {
    console.log('delete');
  };
  return (
    <>
      <div className="todo_style">
        <i className="fa fa-times" aria-hidden="true" onClick={deleteItem} />
        <li>{props.text}</li>
      </div>
    </>
  );
};

export default ToDoList;
